    <script>
        $(document).on('turbolinks:load', function () {


            Currency.format = 'money_format';

            var shopCurrency = 'USD';

            /* Sometimes merchants change their shop currency, let's tell our JavaScript file */
            Currency.moneyFormats[shopCurrency].money_with_currency_format = "${{amount}} USD";
            Currency.moneyFormats[shopCurrency].money_format = "${{amount}}";

            /* Default currency */
            var defaultCurrency = 'USD';

            /* Cookie currency */
            var cookieCurrency = Currency.cookie.read();

            /* Fix for customer account pages */
            $('.money .money').each(function () {
                $(this).parents('.money').removeClass('money');
            });

            /* Saving the current price */
            $('.money').each(function () {
                $(this).attr('data-currency-USD', $(this).html());
            });

            var $picker = $('[name="currencies"]');

            // If there's no cookie.
            if (cookieCurrency == null) {
                if (shopCurrency !== defaultCurrency) {
                    Currency.convertAll(shopCurrency, defaultCurrency, '.money');
                } else {
                    Currency.currentCurrency = defaultCurrency;
                }
            }
            // If the cookie value does not correspond to any value in the currency dropdown.
            else if ($picker.length && $picker.find('option[value=' + cookieCurrency + ']').length === 0) {
                Currency.currentCurrency = shopCurrency;
                Currency.cookie.write(shopCurrency);
            } else if (cookieCurrency === shopCurrency) {
                Currency.currentCurrency = shopCurrency;
            } else {
                Currency.convertAll(shopCurrency, cookieCurrency, '.money');
            }

            $picker.val(Currency.currentCurrency);

            $(document)
                .ready(function () {
                    $('[name="currencies"]').val(Currency.currentCurrency);
                })
                .on('change', '[name="currencies"]', function (event) {
                    var newCurrency = $(event.target).val();
                    $('[name="currencies"]').val(newCurrency);
                    Currency.convertAll(Currency.currentCurrency, newCurrency, '.money');
                    $('.selected-currency').text(newCurrency);
                });

            var original_selectCallback = window.selectCallback;
            var selectCallback = function (variant, selector) {
                original_selectCallback(variant, selector);
                Currency.convertAll(shopCurrency, $('[name="currencies"]').val(), '.money');
                $('.selected-currency').text(Currency.currentCurrency);
            };

            $('body').on('ajaxCart.afterCartLoad', function (cart) {
                Currency.convertAll(shopCurrency, $('[name="currencies"]').val(), '.money');
                $('.selected-currency').text(Currency.currentCurrency);
            });

            $('.selected-currency').text(Currency.currentCurrency);


        });
    </script>


